/962985656/?backend=innertube\u0026cname=1\u0026cver=2_20240808\u0026data=backend%3Dinnertube%3Bcname%3D1%3Bcver%3D2_20240808%3Bptype%3Df_view%3Btype%3Dview%3Butuid%3DzH5n3Ih5kgQoiDAQt2FwLw%3Butvid%3DstoPYwdPU-E\u0026is_vtc=0\u0026ptype=f_view\u0026random=604967270\u0026utuid=zH5n3Ih5kgQoiDAQt2FwLw","elapsedMediaTimeSeconds":0}},"videoDetails":{"videoId":"stoPYwdPU-E","title":"\"Bread Porn\" the Perfect Sourdough Loaf","lengthSeconds":"531","keywords":["intro to bread","tartine recipe","brothers green eats","brean porn","everything bagel","home milling","sourdough screw up","mike greenfield","nutrimill","milling flour","the perfect bread","beginners sourdough bread","enzyme tire spunk","how to make sourdough bread","flour mill","perfect sourdough recipe","the perfect loaf","master bread making","tartine loaf","bread fail"],"channelId":"UCzH5n3Ih5kgQoiDAQt2FwLw","isOwnerViewing":false,"shortDescription":"Wanna learn how to bake fresh, delicious, artisanal style sourdough bread at home?  (No matter how busy your schedule is)\nClick the link below and download my FREE bread baking checklists:\nhttps://prohomecooksu.com/5-sourdough-checklists/\n\nShop the gear in this video below!\nExtra Long Silicone Oven Mitts: https://amzn.to/2BBFL8E\nMisen Serrated Bread Knife: https://amzn.to/3sPpwzm\nEtekcity Digital Food Scale: https://amzn.to/305du3G\nBread Bosses Bread Lame: https://amzn.to/3f8B04e\n2 Oval Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAo g.com/vi/stoPYwdPU-E/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/stoPYwdPU-E","width":1280,"height":720},"title":{"simpleText":"\"Bread Porn\" the Perfect Sourdough Loaf"},"description":{"simpleText":"Wanna learn how to bake fresh, delicious, artisanal style sourdough bread at home?  (No matter how busy your schedule is)\nClick the link below and download my FREE bread baking checklists:\nhttps://prohomecooksu.com/5-sourdough-checklists/\n\nShop the gear in this video below!\nExtra Long Silicone Oven Mitts: https://amzn.to/2BBFL8E\nMisen Serrated Bread Knife: https://amzn.to/3sPpwzm\nEtekcity Digital Food Scale: https://amzn.to/305du3G\nBread Bosses Bread Lame: https://amzn.to/3f8B04e\n2 Oval Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin"},"lengthSeconds":"531","ownerProfileUrl":"http://www.youtube.com/@ProHomeCooks","externalChannelId":"UCzH5n3Ih5kgQoiDAQt2FwLw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","L  Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin","commandRuns":[{"startIndex":189,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CI0CEM2rARgBIhMIhviWgdnthwMVJk-4BB2TcQXpSOGnvbqw7IPtsgE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa0d2WEhNeXBpQVluXy00ZlNxRFpXRHA1NEJ1UXxBQ3Jtc0tuOXJubWw3NlQwU3A2ZTJLaUR5NVZYS3JxTDNiRGZzUG5Pa2JyVnRRV3dpTFA3Mk1ESkRsN21iR3V1TTVXVGRSc05fd3dPcGlpU3FqVEE5SWtLLTJxUlkxTzM1YXhlY2tIMU1ucW5zZ19IQ3FlYTVPTQ\u0026q=https%3A%2F%2Fprohomecooksu.com%2F5-sourdough-checklists%2F\u0026v=stoPYwdPU-E","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa0d2WEhNeXBpQVluXy00ZlNxRFpXRHA1NEJ1UXxBQ3Jtc0tuOXJubWw3NlQwU3A2ZTJLaUR5NVZYS3JxTDNiRGZzUG5Pa2JyVnRRV3dpTFA3Mk1ESkRsN21iR3V1TTVXVGRSc05fd3dPcGlpU3FqVEE5SWtLLTJxUlkxTzM1YXhlY2tIMU1ucW5zZ19IQ3FlYTVPTQ\u0026q=https%3A%2F%2Fprohomecooksu.com%2F5-sourdough-checklists%2F\u0026v=stoPYwdPU-E","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":298,"length":23,"onTap":{"innertubeCommand":{"clickTrackingParams":"CI0CEM2rARgBIhMIhviWgdnthwMVJk-4BB2TcQXpSOGnvbqw7IPtsgE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbHVJRWYzdlNNMDJVd3VQaHR1cHd0TVhHdzZsd3xBQ3Jtc0tuWl9faFBJZEd2SmVQNU9XZ1dKSXo5NC1oVzhBSkxvRUNsV192OVVWc29qTjl6ak1vZVYzS29rc0lzd3ZGbU93S3NUNEQ2SlJwUDYzUTVGeDlFNW14QWhoVlp4S1Z2QkJaazFnWHBTcWc2dXVCMVNsYw\u0026q=https%3A%2F%2Famzn.to%2F2BBFL8E\ ail":{"thumbnails":[{"url":"https://yt3.ggpht.com/saUT3pTb6OQeVNzSelFemx3wrn8ymSUAXchlOzXJOPL5KaotGydRSOcLLAeZttMW5MqzLUa6KdU=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Wanna learn how to bake fresh, delicious, artisanal style sourdough bread at home?  (No matter how busy your schedule is)\nClick the link below and download my FREE bread baking checklists:\nhttps://prohomecooksu.com/5-sourdough...\n\nShop the gear in this video below!\nExtra Long Silicone Oven Mitts: https://amzn.to/2BBFL8E\nMisen Serrated Bread Knife: https://amzn.to/3sPpwzm\nEtekcity Digital Food Scale: https://amzn.to/305du3G\nBread Bosses Bread Lame: https://amzn.to/3f8B04e\n2 Oval Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin","commandRuns":[{"startIndex":189,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CC8Q040EGAQiEwiG-JaB2e2HAxUmT7gEHZNxBelI4ae9urDsg-2yAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVNaMGl2MnFuNm9ocnFxSWNOYXBlSXh6X25Yd3xBQ3Jtc0trRi1wVi1kUHJTajIxX0xsX1dKZ3JLRjlQalZRSHl3ZmlDMDNrVlJ2UDJIVUhpaTAzUmc5SEJkZEphZDhSbGM3cUQwV1J6WVU3WW9sTVIySzRSOHdrUVJsTUhneEhxTExvZ25XMWl3eHlKQjdyX2hVMA\u0026q=https%3A%2F%2Fprohomecooksu.com%2F5-sourdough-checklists%2F\u0026v=stoPYwdPU-E","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVNaMGl2MnFuNm9ocnFxSWN
